import "./App.css";
import Weather from "./Weather";

function App() {
  function Link() {
    return (
      <a href=" https://github.com/Nicola-laing/weather-react-app.git">
        Github
      </a>
    );
  }

  return (
    <div className="app-container">
      <h1> Weather</h1>
      <Weather />
      <div>
        <p className="city-info"></p>
        <p className="temp"></p>
      </div>
    </div>
  );
}

export default App;
